import { Main } from './routers/Main'
import {TopNav} from './components/navs/TopNav'
import {Head} from './components/Head'
import {Footer} from './components/Footer'
import { Dps } from './tematicas/dps';

export const DpsApp = () => {
    return(
        <div>
            <TopNav/>
            <Head/>
            <Main/>
            <Dps/>
            <Footer/>
        </div>

    )
  };
